function renderGrid(provName, mountEl){
  const wrap=mountEl; wrap.innerHTML="";
  (PROVIDERS[provName]||[]).forEach(f=>{
    const isSel = state.provider===provName && state.formato===f.id;
    const src= (state.imagenes?.[provName]?.[f.id]) || ph(f.nombre);
    const card=document.createElement("div");
    card.className="card"+(isSel?" sel":"")+(state.pinOk && !state.readOnly? " edit":"");
    card.setAttribute("data-prov",provName);
    card.setAttribute("data-fmt",f.id);
    card.innerHTML=`
      <div class="img">
        <img id="img-${provName}-${f.id}" alt="" src="${src}">
        <button class="upbtn" title="Subir imagen">Subir</button>
      </div>
      <div class="cap">${f.nombre}</div>
      <input type="file" class="file" accept="image/*" style="display:none"/>
    `;

    card.addEventListener("click",(e)=>{
      if(e.target.classList.contains("upbtn")) return;
      state.provider=provName;
      state.formato=f.id;
      try{ window.state = state; }catch(e){} save(); renderAll(); /* scrollIntoView disabled by request: keep viewport static */
      fillSide(); renderAccSelect(); calc();
    });

    const btn=card.querySelector(".upbtn");
    const file=card.querySelector(".file");
    btn?.addEventListener("click",(e)=>{
      if(state.readOnly || !state.pinOk) { if(!state.readOnly) alert("Introduce el PIN en Editar para cambiar la imagen"); return; }
      e.stopPropagation(); file.click();
    });
    file?.addEventListener("change",(e)=>{
      if(state.readOnly) return;
      const fileObj=e.target.files[0]; if(!fileObj) return;
      const r=new FileReader();
      r.onload=()=>{ state.imagenes[provName][f.id]=r.result; save(); renderAll(); };
      r.readAsDataURL(fileObj);
    });

    wrap.appendChild(card);
  });
}

/* Reglas 2 pareja */
function allowedParejaSet(gamaId){
  if(gamaId==="diamante") return ["diamante","platino","oro"];
  if(gamaId==="platino") return ["platino","oro"];
  if(gamaId==="oro") return ["oro"];
  return [];
}
function aplicarReglasPareja(defaulter=true){
  const allowed = allowedParejaSet(state.gamaId);
  if(allowed.length===0){
    state.parejaActivo=false;
    state.parejaGamaId="platino";
    return;
  }
  state.parejaActivo=true;
  if(defaulter || !allowed.includes(state.parejaGamaId)){
    const preferSame = allowed.includes(state.gamaId) ? state.gamaId : allowed[0];
    state.parejaGamaId = preferSame;
  }
}

