function renderAccSelect(){
  const box=$("#accGrid"); if(!box) return;
  box.innerHTML="";
  const prov=state.provider, fmtId=state.formato;
  const sel=state.accSelected?.[prov]?.[fmtId] || {};
  const prices=state.accPrices?.[prov]?.[fmtId] || {};

  ACCESS_LIST.forEach(a=>{
    const on = !!sel[a.id];
    const price = Number(prices[a.id] ?? a.def);
    const item=document.createElement("div");
    const label = (ACCESS_LABELS_BY_PROVIDER?.[prov]?.[a.id]) || a.nombre;
    item.className="accItem"+(on?" on":"")+(state.pinOk && !state.readOnly? " edit": "");
    item.setAttribute("data-acc", a.id);
    item.innerHTML=`
      <div class="accLabel">${label}</div>
      <div class="accPrice">${fmtEur(price)} <button class="pencil" title="Editar precio"></button></div>
    `;
    item.addEventListener("click",(e)=>{
      if(e.target.classList.contains("pencil")) return;
      sel[a.id] = !on;
      if(!state.accSelected[prov]) state.accSelected[prov]={};
      if(!state.accSelected[prov][fmtId]) state.accSelected[prov][fmtId]={};
      state.accSelected[prov][fmtId][a.id]=sel[a.id];
      save(); renderAccSelect(); calc();
    });
    const pencil=item.querySelector(".pencil");
    pencil?.addEventListener("click",(e)=>{
      e.stopPropagation();
      if(state.readOnly || !state.pinOk){ if(!state.readOnly) alert("Introduce el PIN en Editar para modificar precios"); return; }
      const cur = price;
      const nv = prompt(`Precio para ${a.nombre}`, String(cur).replace(",", "."));
      if(nv===null) return;
      const num = Number(nv);
      if(!isFinite(num) || num<0){ alert("Introduce un nmero vlido"); return; }
      if(!state.accPrices[prov]) state.accPrices[prov]={};
      if(!state.accPrices[prov][fmtId]) state.accPrices[prov][fmtId]={};
      state.accPrices[prov][fmtId][a.id]=Math.round(num);
      save(); renderAccSelect(); calc();
    });
    box.appendChild(item);
  });
}

