/* financiacin */
function accTotalForCurrent(){
  const prov=state.provider, fmt=state.formato;
  const sel=state.accSelected?.[prov]?.[fmt] || {};
  const prices=state.accPrices?.[prov]?.[fmt] || {};
  let sum=0;
  ACCESS_LIST.forEach(a=>{ if(sel[a.id]) sum+= Number(prices[a.id] ?? a.def) || 0; });
  return sum;
}
function calc(){
  const base=gamaById(state.gamaId).precio;
  const accT = accTotalForCurrent();
  const importe = base + accT;

  const c36=importe/42, rest=importe - c36*36, c6=mensualidad(rest,6,0.0795);
  $("#impBase").textContent=fmt(importe);
  $("#c36Base").textContent=fmt(c36);
  $("#miniBase").textContent=`${fmt(importe)} / 42`;
  $("#restBase").textContent=fmt(rest);
  $("#c6Base").textContent=fmt(c6);

  let pareja=0; if(state.parejaActivo){ pareja=PAREJA_PRECIOS[state.parejaGamaId]||0; }
  const total=importe+pareja;
  const c36u=total/42, restu=total - c36u*36, c6u=mensualidad(restu,6,0.0795);
  $("#impUpg").textContent=fmt(total);
  $("#c36Upg").textContent=fmt(c36u);
  $("#miniUpg").textContent=`${fmt(total)} / 42`;
  $("#restUpg").textContent=fmt(restu);
  $("#c6Upg").textContent=fmt(c6u);
}

