/* ===== Left accessories thumbnails (x4) ===== */

/* === Setup collapsibles and height sync === */
function setupDrawers(){
  try{
    // LEFT: wrap accImgsLeftBox content into a details drawer once
    var leftBox = document.getElementById("accImgsLeftBox");
    if(leftBox && !leftBox.dataset.drawerized){
      var grid = document.getElementById("accImgsLeftGrid");
      var helper = leftBox.querySelector(".helper");
      // Create structure
      var det = document.createElement("details");
      det.className = "accLeftDrawer";
      det.open = true;
      var sum = document.createElement("summary");
      sum.textContent = "Imgenes de accesorios con Bluetooth";
      var body = document.createElement("div");
      body.className = "drawerBody";
      // Move content
      var priceBox = document.getElementById("accSelBox");
      // Keep left order: prices > images (drawer)
      body.appendChild(grid);
      if(helper) body.appendChild(helper);
      det.appendChild(sum); det.appendChild(body);
      // Replace leftBox children
      leftBox.innerHTML = "";
      leftBox.appendChild(det);
      leftBox.dataset.drawerized = "1";
    }

    // RIGHT: create sideStack with two drawers (Caractersticas & Accesorios detalle)
    var side = document.querySelector(".side");
    if(side && !side.querySelector(".sideStack")){
      var txt = document.getElementById("txtCar");
      var note = side.querySelector(".note");
      var accDet = document.getElementById("accDetails");
      var title = document.getElementById("sideTitle"); // h3

      var sideStack = document.createElement("div");
      sideStack.className = "sideStack";

      // Drawer 1: Caractersticas (includes textarea + note)
      var d1 = document.createElement("details");
      d1.className = "drawer";
      d1.open = true;
      var s1 = document.createElement("summary");
      s1.textContent = title ? title.textContent : "Caractersticas";
      var b1 = document.createElement("div");
      b1.className = "drawerBody";
      if(txt){ b1.appendChild(txt); }
      if(note){ b1.appendChild(note); }

      d1.appendChild(s1); d1.appendChild(b1);

      // Drawer 2: Accesorios (detalle): rehost existing details content
      if(accDet){
        // ensure it's open by default
        accDet.open = true;
        // If accDet isn't styled as drawer, it will be styled by .sideStack details rule
        sideStack.appendChild(d1);
        sideStack.appendChild(accDet);
        // place sideStack at top of side (remove h3 since summary holds the title)
        if(title && title.parentNode===side) side.removeChild(title);
        side.insertBefore(sideStack, side.firstChild);
      }
    }
  }catch(e){}
}

function syncHeights(){
  try{
    if(window.innerWidth < 900) { document.querySelector(".side").style.setProperty("--sideH","auto"); return; }
    var left = document.getElementById("accImgsLeftBox");
    var side = document.querySelector(".side");
    if(!left || !side) return;
    var rect = left.getBoundingClientRect();
    var h = rect.height;
    // Add small compensation for borders/margins
    h = Math.max(320, Math.round(h));
    side.style.setProperty("--sideH", h + "px");
  }catch(e){}
}


/* === Provider-level accessory images (lazy + backward-compatible) === */
function ensureAccProvImgs(prov){
  state.accProvImgs = state.accProvImgs || {};
  if(!state.accProvImgs[prov]) state.accProvImgs[prov] = [null,null,null,null];
  return state.accProvImgs[prov];
}
function seedAccProvFromExisting(prov){
  const arr = ensureAccProvImgs(prov);
  if(arr.filter(Boolean).length>0) return; // already has images
  const take=[];
  try{
    (PROVIDERS[prov]||[]).forEach(f=>{
      ["diamante","platino","oro"].forEach(g=>{
        const a = (((state.accesorios||{})[prov]||{})[f.id]||{})[g];
        if(a){
          if(a.img1 && !take.includes(a.img1)) take.push(a.img1);
          if(a.img2 && !take.includes(a.img2)) take.push(a.img2);
          if(a.img3 && !take.includes(a.img3)) take.push(a.img3);
          if(a.img4 && !take.includes(a.img4)) take.push(a.img4);
        }
      });
    });
  }catch(e){}
  for(let i=0;i<4;i++){ arr[i]=take[i]||arr[i]||null; }
}

function renderAccImgsLeft(){
  try{
    var grid = document.getElementById("accImgsLeftGrid");
    if(!grid) return;
    var prov=state.provider, fmtId=state.formato, g=state.gamaId;
    // Seed provider-level from any existing images so we don't lose your prior edits
    seedAccProvFromExisting(prov);
    var provArr = ensureAccProvImgs(prov).slice();
    grid.innerHTML = "";
    for(var i=1;i<=4;i++){
      var src = provArr[i-1] || phAcc(i);
      var card = document.createElement("div");
      card.className = "accLeftCard" + (state.pinOk && !state.readOnly ? " edit" : "");
      card.innerHTML = '<img id="accLeftImg'+i+'" src="'+src+'" alt="Accesorio '+i+'">'+
                       '<button class="accLeftUp">Subir</button>'+
                       '<input type="file" id="accLeftFile'+i+'" accept="image/*" style="display:none"/>';
      (function(i, card){
        var btn = card.querySelector(".accLeftUp");
        var file = card.querySelector("#accLeftFile"+i);
        if(btn) btn.addEventListener("click", function(e){
          if(state.readOnly || !state.pinOk){ if(!state.readOnly) alert("Introduce el PIN en Editar para subir imgenes"); return; }
          e.preventDefault(); file && file.click();
        });
        if(file) file.addEventListener("change", function(e){
          if(state.readOnly || !state.pinOk) return;
          var f=e.target.files[0]; if(!f) return;
          var r=new FileReader();
          r.onload=function(){
            // Save at PROVIDER level (fixed across formatos/gamas)
            ensureAccProvImgs(state.provider)[i-1] = r.result;
            // Mirror into current formato/gama (keeps compatibility with right-side detail and exports)
            try{
              var acc = ensureAcc(state.provider, state.formato, state.gamaId);
              if(i===1) acc.img1 = r.result;
              if(i===2) acc.img2 = r.result;
              if(i>2){ acc["img"+i] = r.result; } // no-op for right panel but persisted
            }catch(e){}
            if(typeof save==='function') save();
            renderAccImgsLeft();
            if(typeof syncHeights==='function') syncHeights();
          };
          r.readAsDataURL(f);
        });
      })(i, card);
      grid.appendChild(card);
    }
    // Update drawer title to include provider
    var det = document.querySelector("#accImgsLeftBox details.accLeftDrawer > summary");
    if(det){ det.textContent = "Imgenes de accesorios con Bluetooth  " + prov; }
  }catch(e){ /* no-op */ }
}

/* Hook functions to refresh left grid without touching original code */
(function(){
  function wrap(name){
    var fn = window[name];
    if(typeof fn !== 'function') return;
    window[name] = function(){
      var r = fn.apply(this, arguments);
      try{ renderAccImgsLeft(); }catch(e){}
      return r;
    };
  }
  wrap("fillSide");
  wrap("setGama");
  wrap("renderAccSelect");
  // first render
  setTimeout(function(){ try{ renderAccImgsLeft(); }catch(e){} }, 0);
})();
window.addEventListener('resize', syncHeights);

/* === Toolbar de edicin para txtCar y accDesc (negrita / sombreado) === */
function wrapSelectionTextArea(ta, left, right){
  if(!ta) return;
  const start = ta.selectionStart ?? 0;
  const end = ta.selectionEnd ?? 0;
  const val = ta.value || "";
  const sel = val.slice(start, end);
  const out = val.slice(0, start) + left + sel + right + val.slice(end);
  ta.value = out;
  try{ ta.focus(); ta.selectionStart = start + left.length; ta.selectionEnd = start + left.length + sel.length; }catch(e){}
  // Notificar a los listeners existentes (para que guarde al vuelo)
  try{ ta.dispatchEvent(new Event('input', {bubbles:true})); }catch(e){}
}

function ensureEditBarFor(ta, id){
  if(!ta) return;
  if(document.getElementById(id)) return; // ya creado
  const bar = document.createElement('div');
  bar.className = 'editBar';
  bar.id = id;
  const bBold = document.createElement('button');
  bBold.className = 'smallBtn';
  bBold.type = 'button';
  bBold.textContent = 'Negrita';
  bBold.addEventListener('click', ()=>wrapSelectionTextArea(ta,'**','**'));
  const bMark = document.createElement('button');
  bMark.className = 'smallBtn';
  bMark.type = 'button';
  bMark.textContent = 'Sombreado';
  bMark.addEventListener('click', ()=>wrapSelectionTextArea(ta,'==','=='));
  // Respetar modo lectura/PIN
  const locked = (typeof state!=='undefined' && (state.readOnly || !state.pinOk));
  bBold.disabled = locked; bMark.disabled = locked;
  bar.style.opacity = locked ? '.6' : '1';
  ta.parentNode.insertBefore(bar, ta); // lo colocamos justo encima del textarea
}

function addEditBars(){
  try{
    ensureEditBarFor(document.getElementById('txtCar'), 'barCar');
    ensureEditBarFor(document.getElementById('accDesc'), 'barAcc');
  }catch(e){}
}


/* === Sync descripcin height to left images box === */
function syncDescSize(){
  try{
    var left = document.getElementById('accImgsLeftBox');
    var ta = document.getElementById('accDesc');
    if(!left || !ta) return;
    var h = left.getBoundingClientRect().height;
    var pad = 70; // compensate summary/label paddings
    var target = Math.max(160, Math.round(h - pad));
    ta.style.minHeight = target + 'px';
  }catch(e){}
}
window.addEventListener('load', syncDescSize);
window.addEventListener('resize', syncDescSize);
(function(){
  var _old = window.renderAccImgsLeft;
  if(typeof _old === 'function'){
    window.renderAccImgsLeft = function(){
      var r = _old.apply(this, arguments);
      try{ syncDescSize(); }catch(e){}
      return r;
    };
  }else{
    // fallback initial call
    setTimeout(syncDescSize, 0);
  }
})();

